import React from 'react';
// import useAxios from 'axios-hooks';
import {
  TextField, Grid, Typography,
} from '@material-ui/core';

export default function SharedPage(): JSX.Element {
  // const [{ data }, reload] = useAxios(
  //   { url: 'http://localhost:3000/room', method: 'POST' },
  // );
  return (

    <Grid container>
      <Grid item xs={12} style={{ paddingBottom: 30, justifyContent: 'left' }}>
        <Typography style={{ fontSize: 30 }}>
          판매 하기
        </Typography>
      </Grid>
      <Grid item xs={12} style={{ paddingBottom: 30, justifyContent: 'left' }}>
        <Typography style={{ fontSize: 30 }}>
          판매할 책
        </Typography>
      </Grid>

      <Grid item xs={12}>
        <TextField
          id="outlined-multiline-static"
          style={{ width: '100%' }}
          multiline
          rows={6}
          defaultValue="Default Value"
          variant="outlined"
          fullWidth
        />
        {/* <input id="outlined" style={{ width: '100%' }} /> */}
      </Grid>
    </Grid>
  );
}
